from collections import defaultdict

def solve():
    n = int(input())
    prefixes = defaultdict(list)
    suffixes = defaultdict(list)

    for i in range(2 * n - 2):
        s = input()
        length = len(s)
        prefixes[length].append(s)
        suffixes[length].append(s)

    for length in range(1, n):
        prefixes[length].sort()
        suffixes[length].sort()

    result = ['P'] * (2 * n - 2)
    for i in range(2 * n - 2):
        s = input()
        length = len(s)
        if prefixes[length] == [s]:
            result[i] = 'P'
        elif suffixes[length] == [s]:
            result[i] = 'S'

    print(''.join(result))

if __name__ == "__main__":
    t = 1
    for _ in range(t):
        solve()
